import React from "react";

function Home() {
  return (
    <div className="home">
      <div 
				style={{
					minWidth: "100vw",
					minHeight: "100vh",
					position: "relative",
					overflow: "hidden"
				}}
			>
        <div 
          style={{ 
            marginLeft: "160px",
            marginRight: "160px"
          }}
        >
          <div className="first-section">
            <div
              style={{
                minHeight: "25vh",
                maxWidth: "100%",
                display: "flex",
                textAlign: "center",
                justifyContent: "center",
                flexDirection: "column"
              }}
						>
              <h1>
                Northwestern University<br></br>Science Olympiad
              </h1>
              <p
									style={{
										fontSize: "24px",
										maxWidth: "525px",
										marginTop: "30px",
										lineHeight: 1.65,
										color: "#1b4332"
									}}
								>
									I'm a software engineer and data scientist interested in improving human experiences through work.
								</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
